    "update-part1": {                                "en": "Because ioBroker runs on many very different platforms, only manual updating is possible at the moment. To start the manual update, please go to your controller via console and execute the following:", "de": "Wegen der Vielzahl der HW-Plattformen, auf denen ioBroker laufen kann, muss man denn js-controller manuell updaten. Um das durchzuführen geben Sie an der Konsole des Hosts folgende Kommandos aus:", "ru": "Из-за очень разного оборудования на котором может бежать ioBroker возможно только ручное обновлени. Для ручного обновления нужно открыть командную консоль и ввести следующее:", "pt": "Devido ao grande número de plataformas de hardware que o ioBroker pode ser executado, você precisa atualizar o js-controller manualmente. Para fazer isso, execute os seguintes comandos no console do host:", "nl": "Vanwege heel verschillende platforms, waar ioBroker kan draaien. Het is alleen een handmatige update die nu mogelijk is. Ga voor handmatige update naar je controller via console en voer het volgende uit:", "fr": "En raison de plates-formes très différentes, où ioBroker peut fonctionner. C'est seulement la mise à jour manuelle possible maintenant. Pour exécuter la mise à jour manuelle, veuillez vous rendre à votre contrôleur via la console et exécuter:", "it": "Poiché ioBroker funziona su molte piattaforme molto diverse, al momento è possibile solo l'aggiornamento manuale. Per avviare l'aggiornamento manuale, andare al controller tramite console ed eseguire quanto segue:"},
